# FIXING STABILIZER 131:
s = stabilizers[-1] # Length 134
# Remove the char at index 99 (before the last ZZZZZ block starting at 100)
# Indices in string: ... I(98) I(99) Z(100) Z(101) ...
# Removing I(99) makes Z(100) move to 99.
s_fixed = s[:99] + s[100:]
stabilizers[-1] = s_fixed

print(f"Loaded {len(stabilizers)} stabilizers")
lengths = set(len(s) for s in stabilizers)
if len(lengths) != 1:
    print(f"Error: Stabilizers have different lengths: {lengths}")
    exit(1)
n_qubits = list(lengths)[0]
print(f"Number of qubits: {n_qubits}")

try:
    tableau = stim.Tableau.from_stabilizers([stim.PauliString(s) for s in stabilizers], allow_underconstrained=True, allow_redundant=True)
    
    circuit = tableau.to_circuit("elimination")
    
    # Save the circuit
    with open("circuit_133_candidate.stim", "w") as f:
        f.write(str(circuit))
    print("Circuit generated and saved to circuit_133_candidate.stim")

    # Save fixed stabilizers
    with open("stabilizers_133_fixed.txt", "w") as f:
        for s in stabilizers:
            f.write(s + "\n")
    
except Exception as e:
    print(f"Error: {e}")
